#include <iostream>#include <queue>#include <vector>int ans[10] = {0};void calc(std::queue<int> A) {  int x, y;  x = A.front();  A.pop();  y = A.front();  A.pop();  if (A.size() == 0) {    ans[(x + y) % 10] = (ans[(x + y) % 10] + 1) % 998244353;  } else {    A.push((x + y) % 10);    calc(A);  }}int main() {  int N;  std::cin >> N;  std::queue<int> A;  int a;  for (int i = 0; i < N; i++) {    std::cin >> a;    A.push(a);  }  calc(A);  for (int i = 0; i < 10; i++) {    std::cout << ans[i] << std::endl;  }}